import React, { useState } from 'react';
import styled from 'styled-components';
import { Container } from '../styles/globalStyles';

const FeedbackContainer = styled.div`
  padding: 20px;
`;

const SectionTitle = styled.h2`
  color: ${props => props.theme.text};
  margin-bottom: 20px;
  font-size: 24px;
  font-weight: 700;
`;

const FeedbackGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 20px;
  margin-bottom: 30px;
`;

const FeedbackCard = styled.div`
  background: ${props => props.theme.cardBg};
  border-radius: 12px;
  padding: 20px;
  box-shadow: 0 4px 20px ${props => props.theme.shadow};
  border: 1px solid ${props => props.theme.border};
  animation: fadeIn 0.6s ease forwards;
`;

const StudentInfo = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 15px;
`;

const StudentAvatar = styled.img`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  object-fit: cover;
  margin-right: 10px;
`;

const StudentName = styled.div`
  font-weight: 600;
  color: ${props => props.theme.text};
`;

const CourseName = styled.div`
  font-size: 14px;
  color: ${props => props.theme.text};
  opacity: 0.7;
`;

const Rating = styled.div`
  display: flex;
  margin-bottom: 10px;

  span {
    color: #ffc107;
    font-size: 18px;
    margin-right: 2px;
  }
`;

const FeedbackText = styled.p`
  color: ${props => props.theme.text};
  line-height: 1.5;
  font-style: italic;
`;

const DateText = styled.div`
  font-size: 12px;
  color: ${props => props.theme.text};
  opacity: 0.6;
  margin-top: 10px;
`;

const Feedback = () => {
  const [feedback] = useState([
    {
      id: 1,
      student: 'Emma Thompson',
      avatar: 'https://images.unsplash.com/photo-1544725176-7c40e5a71c5e?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'Mathematics 101',
      rating: 5,
      text: 'Professor Johnson explains complex concepts in a way that\'s easy to understand. Her patience and dedication are remarkable.',
      date: '2023-10-15'
    },
    {
      id: 2,
      student: 'James Wilson',
      avatar: 'https://images.unsplash.com/photo-1531427186611-ecfd6d936c79?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'Science Fundamentals',
      rating: 4,
      text: 'Mr. Chen makes science exciting with his hands-on experiments. I look forward to every class!',
      date: '2023-10-12'
    },
    {
      id: 3,
      student: 'Sophia Martinez',
      avatar: 'https://images.unsplash.com/photo-1552058544-f2b08422138a?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'English Literature',
      rating: 5,
      text: 'Ms. Rodriguez has ignited my passion for literature. Her feedback on essays is always constructive and helpful.',
      date: '2023-10-10'
    },
    {
      id: 4,
      student: 'Liam Johnson',
      avatar: 'https://images.unsplash.com/photo-1599566150163-29194dcaad36?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'World History',
      rating: 4,
      text: 'Mr. Kim brings history to life with his engaging storytelling. The class discussions are always thought-provoking.',
      date: '2023-10-08'
    },
    {
      id: 5,
      student: 'Olivia Davis',
      avatar: 'https://images.unsplash.com/photo-1580489944761-15a19d654956?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'Art Appreciation',
      rating: 5,
      text: 'Ms. Williams has helped me discover my artistic side. Her encouragement means everything to me.',
      date: '2023-10-05'
    },
    {
      id: 6,
      student: 'Noah Brown',
      avatar: 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixlib=rb-4.0.3&auto=format&fit=crop&w=100&q=80',
      course: 'Physical Education',
      rating: 3,
      text: 'Coach Taylor is energetic and motivating. I wish we had more variety in the activities though.',
      date: '2023-10-03'
    }
  ]);

  return (
    <FeedbackContainer>
      <Container>
        <SectionTitle>Student Feedback</SectionTitle>

        <FeedbackGrid>
          {feedback.map(item => (
            <FeedbackCard key={item.id}>
              <StudentInfo>
                <StudentAvatar src={item.avatar} alt={item.student} />
                <div>
                  <StudentName>{item.student}</StudentName>
                  <CourseName>{item.course}</CourseName>
                </div>
              </StudentInfo>

              <Rating>
                {[...Array(5)].map((_, i) => (
                  <span key={i}>{i < item.rating ? '★' : '☆'}</span>
                ))}
              </Rating>

              <FeedbackText>"{item.text}"</FeedbackText>

              <DateText>{item.date}</DateText>
            </FeedbackCard>
          ))}
        </FeedbackGrid>
      </Container>
    </FeedbackContainer>
  );
};

export default Feedback;
